INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("2030/12/17 14:59:59", 2, 24001, 102301, 2, 24, "アヤネ", 401, 0.0, 10046, "2020/07/31 12:00:00", 0.0, 0.0, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("2030/12/17 14:59:59", 1, 24002, 102301, 2, 24, "アヤネ", 402, 0.0, 10046, "2020/07/31 12:00:00", 2.21, 0.0, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("2030/12/17 14:59:59", 2, 24003, 102301, 2, 24, "アヤネ", 403, 0.0, 10046, "2020/07/31 12:00:00", 0.0, 0.0, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("2030/12/17 14:59:59", 2, 24004, 192201, 1, 24, "アサヒ", 701, 0.0, 10046, "2020/07/31 12:00:00", 1.99, 0.0, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("2030/12/17 14:59:59", 1, 24005, 192201, 2, 24, "アサヒ", 702, 0.0, 10046, "2020/07/31 12:00:00", 2.21, 0.0, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("2030/12/17 14:59:59", 2, 24006, 192201, 1, 24, "アサヒ", 703, 0.0, 10046, "2020/07/31 12:00:00", 3.33, 0.0, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("2030/12/17 14:59:59", 2, 24007, 192301, 2, 24, "部員３", 801, 0.0, 10046, "2020/07/31 12:00:00", 0.0, 0.0, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("2030/12/17 14:59:59", 1, 24008, 192301, 2, 24, "部員３", 802, 0.0, 10046, "2020/07/31 12:00:00", 2.68, 0.0, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("2030/12/17 14:59:59", 2, 24009, 192301, 2, 24, "部員３", 803, 0.0, 10046, "2020/07/31 12:00:00", 0.0, 0.0, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("2030/12/17 14:59:59", 1, 24010, 192501, 1, 24, "", 501, 0.0, 10046, "2020/07/31 12:00:00", 0.0, 0.0, "やった！");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("2030/12/17 14:59:59", 1, 24011, 192501, 1, 24, "", 502, 0.0, 10046, "2020/07/31 12:00:00", 0.0, 0.0, "勝ったよ！");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("2030/12/17 14:59:59", 1, 24012, 192501, 1, 24, "", 503, 0.0, 10046, "2020/07/31 12:00:00", 0.0, 0.0, "いい調子！");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("2030/12/17 14:59:59", 6, 24013, 113501, 2, 24, "ミサト", 111, 0.0, 10046, "2020/07/31 12:00:00", 5.33, 0.0, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("2030/12/17 14:59:59", 1, 24014, 113501, 2, 24, "ミサト", 112, 0.0, 10046, "2020/07/31 12:00:00", 6.85, 0.0, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("2030/12/17 14:59:59", 1, 24015, 113501, 2, 24, "ミサト", 113, 0.0, 10046, "2020/07/31 12:00:00", 3.0, 0.0, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("2030/12/17 14:59:59", 1, 24016, 192401, 2, 24, "ダイチ", 611, 0.0, 10046, "2020/07/31 12:00:00", 6.11, 0.0, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("2030/12/17 14:59:59", 1, 24017, 192401, 2, 24, "ダイチ", 612, 0.0, 10046, "2020/07/31 12:00:00", 6.75, 0.0, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("2030/12/17 14:59:59", 2, 24018, 192401, 2, 24, "ダイチ", 613, 0.0, 10046, "2020/07/31 12:00:00", 0.0, 0.0, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("2030/12/17 14:59:59", 2, 24019, 113401, 1, 24, "ハツネ", 211, 0.0, 10046, "2020/07/31 12:00:00", 4.52, 0.0, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("2030/12/17 14:59:59", 2, 24020, 113401, 1, 24, "ハツネ", 212, 0.0, 10046, "2020/07/31 12:00:00", 3.89, 0.0, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("2030/12/17 14:59:59", 1, 24021, 113401, 2, 24, "ハツネ", 213, 0.0, 10046, "2020/07/31 12:00:00", 13.49, 0.0, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("2030/12/17 14:59:59", 1, 24022, 106501, 2, 24, "カヤ", 311, 0.0, 10046, "2020/07/31 12:00:00", 3.17, 0.0, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("2030/12/17 14:59:59", 1, 24023, 106501, 2, 24, "カヤ", 312, 0.0, 10046, "2020/07/31 12:00:00", 4.42, 0.0, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("2030/12/17 14:59:59", 6, 24024, 106501, 1, 24, "カヤ", 313, 0.0, 10046, "2020/07/31 12:00:00", 2.89, 0.0, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("2030/12/17 14:59:59", 4, 24025, 102301, 3, 24, "アヤネ", 421, 0.0, 10046, "2020/07/31 12:00:00", 3.71, 0.0, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("2030/12/17 14:59:59", 2, 24026, 192201, 1, 24, "アサヒ", 721, 0.0, 10046, "2020/07/31 12:00:00", 5.1, 0.0, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("2030/12/17 14:59:59", 1, 24027, 192301, 3, 24, "部員３", 821, 0.0, 10046, "2020/07/31 12:00:00", 4.34, 0.0, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("2030/12/17 14:59:59", 1, 24028, 192501, 1, 24, "", 521, 0.0, 10046, "2020/07/31 12:00:00", 0.0, 0.0, "いい勝負だったよ\nまたやろうね");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("2030/12/17 14:59:59", 1, 24029, 113501, 2, 24, "ミサト", 101, 0.0, 10046, "2020/07/31 12:00:00", 5.62, -360.0, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("2030/12/17 14:59:59", 1, 24030, 113501, 2, 24, "ミサト", 102, 0.0, 10046, "2020/07/31 12:00:00", 9.58, -360.0, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("2030/12/17 14:59:59", 2, 24031, 113501, 2, 24, "ミサト", 103, 0.0, 10046, "2020/07/31 12:00:00", 0.0, -360.0, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("2030/12/17 14:59:59", 2, 24032, 113501, 1, 24, "ミサト", 104, 0.0, 10046, "2020/07/31 12:00:00", 9.13, -360.0, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！");
INSERT INTO `v1_a8b1336e4a7d578686df81efa3313830925b4b09c9b77a5983a39ff5a45539a3` VALUES ("2030/12/17 14:59:59", 1, 24033, 113501, 2, 24, "ミサト", 105, 0.0, 10046, "2020/07/31 12:00:00", 8.27, -360.0, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！");
